import React from "react";
import { BrowserRouter, Redirect } from "react-router-dom";
import {
  MDBNav,
  MDBNavItem,
  MDBNavLink,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBContainer,
  MDBEdgeHeader,
  MDBFreeBird,
  MDBIcon,
  MDBNavbarBrand
} from "mdbreact";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";

// import logo from "../../public/H2Studio-small.png";

const TopNavigationBar = props => {
  const users = useSelector(state => state.users.all);

  console.log("USERS: ", users);

  const onStoreClick = () => {
    console.log("CLICKED");
    return <Redirect push to="/store" />;
  };

  return (
    <MDBContainer>
      <MDBNav
        left
        pills
        color="dark"
        style={{ marginTop: "15px", backgroundColor: "white" }}
        // className="navbar fixed-top scrolling-navbar"
        // logo="../../public/H2Studio-small.png"
        // style={{ width: "50%", marginRight: "0" }}
      >
        {/* <MDBNavbarBrand>
          <image src="/H2Studio-small.png" alt="image" />
          <image
            src="https://i.ibb.co/dQcy0LK/H2-STUDIO-FONT-ON-SIDE-BLACK.png"
            alt="logo"
            className="img-fluid z-depth-0"
          />
        </MDBNavbarBrand> */}
        {/* <image src="/H2Studio-small.png" alt="image" /> */}
        <img
          src="https://i.ibb.co/dQcy0LK/H2-STUDIO-FONT-ON-SIDE-BLACK.png"
          alt="logo"
          height="60"
          style={{ marginLeft: "15px", marginRight: "15px" }}
        />
        <MDBNavItem style={{ paddingTop: "15px", paddingBottom: "5px" }}>
          <MDBNavLink to={{ pathname: "/home" }}>Home</MDBNavLink>
        </MDBNavItem>

        <MDBNavItem style={{ paddingTop: "15px", paddingBottom: "5px" }}>
          <MDBNavLink to={{ pathname: "/about" }}>About Us</MDBNavLink>
        </MDBNavItem>

        <MDBNavItem style={{ paddingTop: "15px", paddingBottom: "5px" }}>
          <MDBDropdown>
            <MDBDropdownToggle nav caret color="dark">
              Products
            </MDBDropdownToggle>
            <MDBDropdownMenu color="dark">
              <MDBDropdownItem
                className="productDropDownMenu"
                // style={{ textDecoration: "none" }}
              >
                <Link
                  style={{ textDecoration: "none", color: "#212529" }}
                  to={{
                    pathname: "/store",
                    state: {}
                  }}
                >
                  Store
                </Link>
              </MDBDropdownItem>
              <MDBDropdownItem onClick={onStoreClick}>Custom</MDBDropdownItem>
              <MDBDropdownItem>Business</MDBDropdownItem>
              {/* <MDBDropdownItem divider />
              <MDBDropdownItem>Separated link</MDBDropdownItem> */}
            </MDBDropdownMenu>
          </MDBDropdown>
        </MDBNavItem>

        <MDBNavItem
          style={{
            marginLeft: "auto",
            paddingTop: "15px",
            paddingBottom: "5px"
          }}
        >
          <MDBNavLink to="/cart">
            <MDBIcon icon="shopping-cart" />
            &nbsp;&nbsp;Cart
          </MDBNavLink>
        </MDBNavItem>
        <MDBNavItem style={{ paddingTop: "15px", paddingBottom: "5px" }}>
          <MDBNavLink
            to={{
              pathname: "/login",
              state: {}
            }}
          >
            Login
          </MDBNavLink>
          {/* <Link
            to={{
              pathname: "/login",
              state: {}
            }}
          >
            Login
          </Link> */}
          {/* </MDBNavLink> */}
        </MDBNavItem>
      </MDBNav>
    </MDBContainer>
  );
};

export default TopNavigationBar;
